import React from "react";


const SeriesListItem = ({movieItem}) => {
	return (
		<li>
			{movieItem.show.name}
		</li>
	)
}

const SeriesList = (props) => (
		<div>
		<ul className="">
			{props.list.map(item => (

				 <SeriesListItem movieItem={item} />

				))}
		</ul>
		</div>
	)


export default SeriesList;
